import React, { useEffect, useRef, useState } from "react";
import SideBar from "../components/sidebar";
import axios from "axios";
import { Manifest } from "./tripItems";
import { useParams } from "react-router-dom";
import ReactToPrint from "react-to-print";

const PrintManifest = () =>{
    const id = useParams()
    const tID = id.tripID 
    let componentRef = useRef()

return(
    <>

    <div className="container-fluid">
        <div className="row flex-nowrap">
            <SideBar />
            <div className="col py-5 col-md-9 admin-content table-responsive">
                <ReactToPrint 
                    trigger={() => <button className="btn btn-primary">Print Manifest</button>} 
                    content={() => componentRef}
                />
            <Manifest trip_id={tID} ref={(e) =>(componentRef = e)} />
            </div>
        </div>
    </div> 
    </>
)
}

export default PrintManifest;
